import React from 'react';
import { WiDayCloudyGusts } from "react-icons/wi";

function Navbar() {

    return (
        <div className="cursor-pointer flex flex-row items-center justify-between font-mono text-stone-200 bg-header-primary text-sm md:text-md
         xl:text-2xl p-2 2xl:text-4xl">
            <div className='flex flex-row justify-between items-center mx-auto relative p-1  animate-pulse ease-in-out md:mx-0 lg:p-3'>
                <div className='md:p-1'>
                    <WiDayCloudyGusts className="w-8 h-8 p-0 m-0"/>
                </div>
                <div className="flex flex-col font-semibold tracking-tight items-start relative">
                    <span className="absolute sm:top-7 md:top-8 2xl:top-12">Weather</span>
                </div>
            </div>
            <div className="hidden text-center cursor-pointer tracking-tighter p-1 md:block">
                {new Date().toDateString()}
            </div>
        </div>
    )
}

export default Navbar
